No período, as obras se concentraram basicamente em: 
Instalação das cadeiras da arquibancada; 
Instalação da membrana da nova cobertura; 
Instalação dos refletores e autofalantes no catwalk; 
Execução da montagem da escada rolante; 
Instalação dos elevadores das torres de circulação vertical e internos; 
Execução dos Reservatórios de Água Industrial (RIAI); 
Conclusão de alvenarias; 
Execução de revestimento em paredes e cerâmico de pisos em bares, cozinhas e 
banheiros dos camarotes; 
Instalações das esquadrias; 
Execução de forros (draywall, steel frame e gesso acartonado); 
Execução de impermeabilização de lajes de cozinhas e bares; 
Execução das redes de drenagem pluvial, de água potável, de incêndio e sanitária; 
Execução de instalações hidrossanitárias, rede de incêndio, elétrica e mecânica; 
Execução do lançamento dos cabos de elétrica e dos sistemas eletrônicos; 
Execução das redes do sistema de exaustão e da central de água gelada para o sistema 
de ar-condicionado;  
Instalação de escadas metálicas no setor Oeste e Leste; 
Execução de pintura e acabamento das rampas monumentais.

