Em 31.12.2013, 78,24% das obras civis (de engenharia) foram concluídas. Evolução da Obra em Dez-2013: PIER A: Capeamento nível +2; Montagem dos suportes da tubulação de água gelada; Montagem dos bandejamentos elétricos
PIER B: Montagem das armações dos pilares nível +2;Montagem das formas pilares nível +2;
Concretagem dos pilares nível +2;Montagem de lajes alveolares nível +2;Concretagem de lajes alveolares nível +2.
