Montagem das esteiras-rolantes;Execução de alvenaria em banheiros e salas, fossos de elevadores, etc.;Execução de chapisco, emboço e reboco em banheiros, salas fossos de
elevadores, etc;Continuidade da montagem dos elevadores;Lançamento de cabos elétricos
