GATEHOUSE-PIER-C: Montagem das estruturas metálicas de 13 (doze) GateHouses do Pier-C;Continuidade da montagem das escadas Rolantes;Início da Concretagem das lajes Steel deck dos GateHouses
PÁTIOS: Lançamento da tubulação do Queroduto;Lançamento dos envelopes de Cabos;
Lançamento de macadames;Pavimentação dos pátios.
Edifício Garagem: Continuidade do recebimento e estocagem dos elementos pré-moldados doEdifício Garagem;Continuidade da montagem de pilares vigas e Lajes de todos os níveis; Lançamento da ferragem de intertravamento e concretagem (com acabamentofinal) das lajes (todos os níveis). 
VIADUTO: Confecção dos blocos de fundação e arranque dos pilares;Execução dos pilares de sustentação;Execução das vigas in-loco do Viaduto.Montagem de Vigas Pré-moldadas;Montagem das Lajes Pré-moldadas.Concretagem do pavimento / Capeamento
RAMPA SUL: Termino da concretagem do pavimento / Capeamento
RAMPA NORTE: Execução dos pilares de sustentação;Montagem de Vigas Pré-moldadas;
Montagem das Lajes Pré-moldadas
